import React from 'react';
import { timeout } from 'q';

class SignIn extends React.Component{
    render(){
        setTimeout(() =>{this.props.firebase.checkStatus(this.props.signInBind)}, 450);
        timeout();
        return(
            <div>
                <button id="signIn" onClick={() => {this.props.firebase.doSignIn(this.props.signInBind)}}>Sign in!</button>
                <button id="checkStatus" onClick={this.props.firebase.checkStatus}> Check Status</button>
            </div>
        );
    }
}
export default SignIn;
